import './App.css';
import {HashRouter,Route as Ruta} from 'react-router-dom';
import initial from './components/initial';
//Aca empezamos a codificar y pasar los componentes.
function App() {
  return (
    <div className="App">
      <h1>Henry Food</h1> 
      <Ruta
      path='/'
      component={initial}
      />
    </div>
  );
}

export default App;
